ISLAMABAD, Dec 26 (APP):Federal Government Employees Housing Authority (FGEHA) has postponed the auction of commercial plots of class three and petrol pumps in the G-13 and G-14 sectors.
The auction was set for December 27 and 28, according to a press release. New dates of the auction will be announced soon.
